import React from 'react';
import styled from 'styled-components';

const Button = styled.button`
    width: 29.2rem;
    height: 7rem;
    border-radius: 1.5rem;
    // box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
    background-color: ${props => props.type === 'button' ? '#8B748D' : props.theme.white};
    cursor:pointer;
    margin : 1.5rem;
    display: inline-flex;
    font-family:'Jalnan';
    color:white;
    display:flex;
    justify-content:center;
    align-items:center;
    font-weight: 400;
    font-size:2.0rem;
    text-align:center;
    border:none;

    &:disabled {
        background: white;
        color: orange;
        cursor: not-allowed;
    }
`

function PageMoveButtonComponent({ type, text, onclick }) {
    return (
        <Button type={type} onClick={onclick}>{text}</Button>
    )
}

export default PageMoveButtonComponent;
